        {
            //REcmaHelper::functionStart("REcmaSharedPointerLine::splitAt", context, engine);
            //qDebug() << "ECMAScript WRAPPER: REcmaSharedPointerLine::splitAt";
            //QCoreApplication::processEvents();

            QScriptValue result = engine->undefinedValue();
            
                    // public function: can be called from ECMA wrapper of ECMA shell:
                    RLine* self = 
                        getSelf("splitAt", context);
                  

                //Q_ASSERT(self!=NULL);
                if (self==NULL) {
                    return REcmaHelper::throwError("self is NULL", context);
                }
                
    
    if( context->argumentCount() ==
    1 && (
            context->argument(0).isArray()
        ) /* type: QList < RVector > */
    
    ){
    // prepare arguments:
    
                    // argument isArray
                    QList < RVector >
                    a0;
                    REcmaHelper::fromScriptValue(
                        engine,
                        context->argument(0),
                        a0
                    );
                
    // end of arguments

    // call C++ function:
    // return type 'QList < QSharedPointer < RShape > >'
    QList < QSharedPointer < RShape > > cppResult =
        
               self->splitAt(a0);
        // return type: QList < QSharedPointer < RShape > >
                // List of ...:
                result = REcmaHelper::listToScriptValue(engine, cppResult);
            
    } else


        
            {
               return REcmaHelper::throwError("Wrong number/types of arguments for RLine.splitAt().",
                   context);
            }
            //REcmaHelper::functionEnd("REcmaSharedPointerLine::splitAt", context, engine);
            return result;
        }
         QScriptValue REcmaSharedPointerLine::toString
    (QScriptContext *context, QScriptEngine *engine)
    
    {

    RLine* self = getSelf("toString", context);
    
    QString result;
    
            QDebug d(&result);
            if (self!=NULL) {
                d << *self;
            }
            else {
                d << "NULL";
            }
        
    return QScriptValue(result);
    }
     QScriptValue REcmaSharedPointerLine::copy
    (QScriptContext *context, QScriptEngine *engine)
    
    {
        RLine cp = qscriptvalue_cast<RLine>(context->thisObject());
        return qScriptValueFromValue(engine, cp);
    }
     QScriptValue REcmaSharedPointerLine::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RLine* self = getSelf("RLine", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RLine* REcmaSharedPointerLine::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RLine* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RLinePointer >(context->thisObject())
                
                    ->data()
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RLine.%1(): "
                        "This object is not a RLine").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        RLine* REcmaSharedPointerLine::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RLine* selfBase = getSelf(fName, context);
                RLine* self = dynamic_cast<RLine*>(selfBase);
                //return REcmaHelper::scriptValueTo<RLine >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RLine.%1(): "
                    "This object is not a RLine").arg(fName),
                    context);
            }

            return self;
            


        }
         QScriptValue REcmaSharedPointerLine::data
    (QScriptContext *context, QScriptEngine *engine)
    
    {

    RLine* self = getSelf("data", context);
    return qScriptValueFromValue(engine, self);
    }
     QScriptValue REcmaSharedPointerLine::isNull
    (QScriptContext *context, QScriptEngine *engine)
    
    {

    RLinePointer* self = REcmaHelper::scriptValueTo<RLinePointer >(context->thisObject());

    //RLine* self = getSelf("isNull", context);
    //Q_ASSERT(self!=NULL);
    if (self==NULL) {
        return REcmaHelper::throwError("self is NULL", context);
    }
    return qScriptValueFromValue(engine, self->isNull());
    }
    